import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

class AllContacts extends Component {
  render() {
    return (
      <div className="main">
        <h1>All Contacts</h1>
      </div>
    );
  }
}

export default AllContacts;
